function Dashboard(){
    const [count , setCount] = useState({
        dashboardContent: "dashboard-intro"
    })
    return (
        <div className="dashboard-content">
            <DashboardHeader />
            {/*<DashboardIntro />*/}
            {/*<DashboardOutro />*/}
            <ExpenseTracker  />
        </div>
    )
}

export default Dashboard
